import PostCardFront from './PostCardFront';
import PostCardBack from './PostCardBack';

function PostCard() {
  return (
    <div className="card">
        <PostCardFront className="card__side card__side--front"/>
        <PostCardBack className="card__side card__side--back"/>
    </div>
  );
}

export default PostCard;
